import React from 'react';
import './App.css';
import PixelRiver from './components/PixelRiver';

function App() {
  return (
    <div className="App">
      <main className="hero-section">
        <div className="hero-content">
          <h1 className="hero-title">
            Welcome to the
            <span className="gradient-text"> Digital River</span>
          </h1>
          <p className="hero-subtitle">
            Where code flows like water, creating beautiful digital experiences
          </p>
          <div className="hero-cta">
            <button className="cta-button">
              Dive Into the Code
            </button>
          </div>
        </div>
      </main>
      <PixelRiver />
    </div>
  );
}

export default App;
